import axios from "axios";

export default class DataSource {
  constructor() {
    this.source = "https://cdn.jwplayer.com/v2/playlists/iG6xB42W";
  }
  loadVideos(callBack: Object) {
    let talkObj = {
      method: "get",
      url: this.source,
    };
    axios(talkObj).then(
      (result) => {
        console.log(result);
        // if (result.data.success) {
        //   callBack(result.data);
        // } else {
        //   callBack(result);
        // }
      },
      (error) => {
        console.log("error: " + error.message);
      }
    );
  }
}
